import React from 'react';
import Navbar from '../navbar/Navbar';

class Home extends React.Component {
	render(){
		return(
			<>
				<Navbar />
				<div class="container">
				  <div class="row">
				    <div class="col">
				      1 of 3
				    </div>
				    <div class="col-6">
				      2 of 3 (wider)
				    </div>
				    <div class="col">
				      3 of 3
				    </div>
				  </div>
				</div>
			</>
		)
	}
}

export default Home;
